const App = () =>{
    const [name, setName]= useState();
    const type = (event) =>{
        console.log(event.target.value)
    }
    return(
        <>
            <div>
                <h1>Hello {name}</h1>
                <input type="text" placeholder="Enter your name" onChange={type}></input>
                <button>Click me</button>
            </div>
        </>
    )
};

export default App;
